import * as React from "react";
import { ContactFormProps, FormData } from "../types";

export const ContactForm: React.FC<ContactFormProps> = ({ onSubmit }) => {
  const [formData, setFormData] = React.useState<FormData>({
    fullName: "",
    email: "",
    message: ""
  });

  const handleSubmit = (e: React.FormEvent) => {
    e.preventDefault();
    onSubmit(formData);
  };

  return (
    <form onSubmit={handleSubmit} className="flex flex-col grow shrink self-stretch px-px my-auto text-3xl leading-tight rounded-none min-w-[240px] text-indigo-950 text-opacity-50 w-[298px]">
      <label htmlFor="fullName" className="sr-only">Full Name</label>
      <input
        type="text"
        id="fullName"
        value={formData.fullName}
        onChange={(e) => setFormData({...formData, fullName: e.target.value})}
        placeholder="Full Name"
        className="self-start"
        required
      />
      <label htmlFor="email" className="sr-only">E-mail</label>
      <input
        type="email"
        id="email"
        value={formData.email}
        onChange={(e) => setFormData({...formData, email: e.target.value})}
        placeholder="E-mail"
        className="self-start mt-20 max-md:mt-10"
        required
      />
      <label htmlFor="message" className="sr-only">Message</label>
      <textarea
        id="message"
        value={formData.message}
        onChange={(e) => setFormData({...formData, message: e.target.value})}
        placeholder="Message"
        className="self-start mt-20 max-md:mt-10"
        required
      />
      <button type="submit" className="gap-2.5 self-stretch px-28 py-6 mt-16 text-2xl font-medium text-white bg-indigo-950 rounded-[48px] max-md:px-5 max-md:mt-10">
        Contact Us
      </button>
    </form>
  );
};
